import React from "react";
import styled from "styled-components";

const MainBox = styled.div`
    
`
const CardBox = styled.div`
    width: 480px;
  height: 500px;
  background-color: gray;
  border-radius:5px;
  box-shadow: 0px 0px 3px 2px  lightgray;
`
const CardTitle = styled.p`
    font-size: 25px;
  font-weight: 400;
  color: white;
  position: absolute;
  margin-top: 150px;
  margin-left: 180px;
`
const ContentBox = styled.div`
    width: 480px;
    height:210px;
    background-color: white;
    border-radius:0px 0px 5px 5px;
    position: absolute;
   margin-top: 290px;
`
const CardContent = styled.p`
    font-size: 20px;
  font-weight: 500;
  text-align: left;
  margin-left: 23px;
  margin-right: 40px;
  line-height: 33px;
`
const CardButton1 = styled.div`
    width: 62px;
    height: 35px;
    border: 1.4px solid black;
    border-radius: 5px 0px 0px 5px;
    margin-left: 23px;
`
const ButtonText1 = styled.p`
  font-size: 19px;
  font-weight: 100;
  margin-top: 3px;
  margin-left: 11px;
`
const CardButton2 = styled.div`
    width: 54px;
    height: 35px;
    border: 1.4px solid black;
    border-radius: 0px 5px 5px 0px;
    margin-left: 86px;
    margin-top: -37.5px;
`
const ButtonText2 = styled.p`
   font-size: 19px;
  font-weight: 100;
  margin-top: 3px;
  margin-left: 13px;
`
const Time =  styled.p`
  font-size: 16px;
  color: gray;
  margin-left: 400px;
  margin-top: -27px;
`


const Main = (props) =>{
    return(
        <>
        <MainBox>
            <CardBox>
                <CardTitle>{props.cardTitle}</CardTitle>
              <ContentBox>
                <CardContent>{props.cardContent}</CardContent>
                  <CardButton1>
                  <ButtonText1>View</ButtonText1>
                  </CardButton1>
                 <CardButton2>
                  <ButtonText2>Edit</ButtonText2>
                  </CardButton2>
                  <Time>9 mins</Time>
              </ContentBox>
            </CardBox>
        </MainBox>
        </>
    )
}
export default Main;
